script: |
  super -f text -I q3265.spq | sort > q3265.out

inputs:
  - name: q3265.spq
    data: |
      SELECT + col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE CAST ( NULL AS INTEGER ) * + col0 * + - col1 - + col1 BETWEEN ( + + ( - col2 ) / + + col1 / + 78 ) AND NULL;
  - name: tab1

outputs:
  - name: q3265.out
    data: |
